import React from 'react';
import Track from '../Track/Track';
import styles from './Tracklist.module.css'

const Tracklist = ({ tracks = [], onAdd, isRemoval, onRemove }) => {
  return (
    <div className={styles.tracklist}>
      {tracks.map(track => (
        <Track
          key={track.id}
          track={track}
          onAdd={onAdd}
          isRemoval={isRemoval}
          onRemove={onRemove}
        />
      ))}
    </div>
  );
};

export default Tracklist;
